n      // Start ellipsis\\n      ...(siblingsStart > this.boundaryCount + 2\\n        ? [null]\\n        : this.boundaryCount + 1 < this.pagesCount - this.boundaryCount\\n        ? [this.boundaryCount + 1]\\n        : []),\\n\\n      // Sibling pages\\n      ...range(siblingsStart, siblingsEnd),\\n\\n      // End ellipsis\\n      ...(siblingsEnd < this.pagesCount - this.boundaryCount - 1\\n        ? [null]\\n        : this.pagesCount - this.boundaryCount > this.boundaryCount\\n        ? [this.pagesCount - this.boundaryCount]\\n        : []),\\n\\n      ...endPages\\n    ];\\n\\n    return itemList;\\n  }\\n\\n  /**\\n   * @internal\\n   * @ignore\\n   */\\n  onPageSizeChange(pageSize: number) {\\n    this.pageSizeChange.emit(pageSize);\\n  }\\n\\n  /**\\n   * @internal\\n   * @ignore\\n   */\\n  onPageClick(page: number) {\\n    this.pageChange.emit(page);\\n  }\\n\\n  /**\\n   * @internal\\n   * @ignore\\n   */\\n  onNextPage() {\\n    this.pageChange.emit(Math.min(this.page + 1, this.pagesCount));\\n  }\\n\\n  /**\\n   * @internal\\n   * @ignore\\n   */\\n  onPrevPage() {\\n    this.pageChange.emit(Math.max(1, this.page - 1));\\n  }\\n\\n  /**\\n   * @internal\\n   * @ignore\\n   */\\n  onSubmit(event: Event) {\\n    event.preventDefault();\\n    if (this.pageGoTo) {\\n      const page = Math.max(1, Math.min(+this.pageGoTo, this.pagesCount));\\n      this.pageChange.emit(page);\\n    }\\n  }\\n}\\n","assetsDirs":[],"styleUrlsData":[{"data":".es-paginator {\\n  color: rgba(0, 0, 0, 0.54);\\n  display: flex;\\n  flex-direction: row;\\n  flex-wrap: wrap;\\n  justify-content: space-between;\\n  white-space: nowrap;\\n\\n  &__size {\\n    align-items: center;\\n    display: flex;\\n    margin-bottom: 16px;\\n    margin-right: 24px;\\n  }\\n\\n  &__select {\\n    display: block;\\n    margin-left: 4px;\\n    margin-right: 24px;\\n\\n    &.mat-select {\\n      width: 40px;\\n    }\\n  }\\n\\n  &__pages {\\n    margin-left: auto;\\n  }\\n\\n  &__form {\\n    margin-left: 